import React from 'react';
import Button from '@material-ui/core/Button';

import './style.scss';

const Homepage = () => (
  <div className="home_container">
    <div className="enter">
      <Button variant="contained" size="large" color="primary" className="start">
          start
      </Button>
    </div>
  </div>
);

export default Homepage;
